import React from "react";
import Header from "../layout/Header";
import Footer from "../layout/Footer";
import SliderCont from "../includes/SliderCont";
import ImageCont from "../includes/ImageCont";
import ImgTextCont from "../includes/ImgTextCont";
import CardCont from "../includes/CardCont";
import BannerCont from "../includes/BannerCont";
import TextCont from "../includes/TextCont";


function Main() {
  return (
    <>
      <Header/>
        <ContentsCont>
        <SliderCont/>
          <ImageCont/>
          <ImgTextCont/>
          <CardCont/>
          <BannerCont/>
          <TextCont/>
        </ContentsCont>
      <Footer/>
    </>
  )
}

export default Main;
